    getCommentsList: function getCommentsList(isPage, id) {
      var that = this;
      var data = {
        "cid": id,
        "status": "approved" };

      var page = that.page;
      if (isPage) {
        page++;
      }
      Net.request({
        url: API.getCommentsList(),
        data: {
          "searchParams": JSON.stringify(API.removeObjectEmptyKey(data)),
          "limit": 4,
          "page": page },

        header: {
          'Content-Type': 'application/x-www-form-urlencoded' },

        method: "get",
        dataType: 'json',
        success: function success(res) {
          uni.stopPullDownRefresh();
          that.isLoad = 0;
          if (res.data.code == 1) {
            var list = res.data.data;
            if (list.length > 0) {
              var commentsList = [];
              for (var i in list) {
                var arr = list[i];
                arr.style = "background-image:url(" + list[i].avatar + ");";
                commentsList.push(arr);
              }
              if (isPage) {
                that.page++;
                that.commentsList = that.commentsList.concat(commentsList);
              } else {
                that.commentsList = commentsList;
              }
              _index.localStorage.setItem('commentsList_' + that.cid, JSON.stringify(that.commentsList));

            } else {
              that.moreText = "没有更多评论了";
              if (that.page == 1 && !isPage) {
                _index.localStorage.removeItem('commentsList_' + that.cid);
                that.commentsList = [];
              }

            }

          }

        },
        fail: function fail(res) {
          uni.stopPullDownRefresh();
          uni.showToast({
            title: "网络开小差了哦",
            icon: 'none' });

          that.isLoad = 0;
          var timer = setTimeout(function () {
            that.isLoading = 1;
            clearTimeout('timer');
          }, 300);

          that.moreText = "加载更多";
        } });

    },
